function showAutoSuggestService(keyword, event) {
    if (event.keyCode == 38 || event.keyCode == 40) {
        return;
    }
    if (event.keyCode == 13) {
        jQuery('#auto-suggest-list-service').fadeOut(1000);
    }
    objService  = new listTravelService( 'service-name', 'auto-suggest-list-service', 'key');
    if (keyword.length > 0) {
        count = 0;
        jQuery('#auto-suggest-list-service').html('');
        var english = /^[A-Za-z\s]+$/;
        var showName, showProvider;
        if (discounts.length == 0) {
            var lang = getLang();
            discounts = JSON.parse(sessionStorage.getItem('discount_data_backup_'+lang));
        }

        //jQuery('#auto-suggest-list-service').append(jQuery('#ask-question-button-container').html());
        jQuery.each(discounts, function(key, value) {
            var searchMask = keyword;
            var regEx = new RegExp(searchMask, "ig");

            if (english.test(searchMask)) {
                showName = value.nameEnglish;
                showProvider = value.providerTypeEng;
            }
            else {
                showName = value.name;
                showProvider = value.providerType;
            }

            if ((value.address && value.address.toString().toLowerCase().indexOf(keyword.toLowerCase()) != -1) ||
                (value.name && value.name.toString().toLowerCase().indexOf(keyword.toLowerCase()) != -1) ||
                (value.nameEnglish && value.nameEnglish.toString().toLowerCase().indexOf(keyword.toLowerCase())) != -1)
            {
                itemHTML = "<span class='suggested-name'>" + showName +  "</span><span class='suggested-name-type'>" + showProvider + "</span>";
                jQuery('#auto-suggest-list-service').prepend("<li class='found-item service-item' key='" + key + "' partnerCode='" + value.partnerCode + "' name='" + showName + "' providerType='" + value.providerType + "' loc='" + value.loc + "'>" + itemHTML + "</li>");
            }
        });
    }
    else {
        jQuery('#auto-suggest-list-service').html('');
    }
    if(jQuery('#auto-suggest-list-service li').length > 0){
        jQuery('#auto-suggest-list-service').show();
        jQuery('.found-item').click(function(){
            jQuery('#auto-suggest-list-service').fadeOut(1000);
            getServiceItem(discounts[$(this).attr('key')]);
        })
    }
    else{
        jQuery('#auto-suggest-list-service').hide();
    }
}

function getServiceItem(service)
{
    var currentPath = window.location.pathname;

    $('#service-name').val(service.name);
    if (currentPath.match('discounts/search')) {
        var locationParam = $('#locationsearch').val();
        if (locationParam.length) {
            var getLoc = locationParam.split(" ");
            searchAndFilter(getLoc[0], service.name);
        }
        else
            searchAutoComplete(service.name);
        return false;
    } else  {
        $('form#service-search-by-location').submit();
    }
}

function listTravelService( textBoxId, containerListId, attr1) {
    var ac = this;
    this.textbox     = document.getElementById(textBoxId);
    this.ul          = document.getElementById(containerListId);
    this.list        = this.ul.getElementsByTagName('li');
    this.pointer     = null;

    this.textbox.onkeydown = function( e ) {
        e = e || window.event;
        switch( e.keyCode ) {
            case 38: //up
                ac.selectList(-1);
                break;
            case 40: //down
                ac.selectList(1);
                break;
        }
    }

    this.selectList = function( inc ) {
        if( this.pointer !== null && this.pointer+inc >= 0 && this.pointer+inc < this.list.length ) {
            this.list[this.pointer].style.backgroundColor = 'white';
            this.pointer += inc;
            if(this.list[this.pointer])
            {
                this.list[this.pointer].style.backgroundColor = '#f7f7f7';
                getServiceItem(discounts[this.list[this.pointer].getAttribute(attr1)]);
                this.list[this.pointer].focus();
            }
        }
        if( this.pointer === null ) {
            this.pointer = 0;
            if(this.list[this.pointer])
            {
                this.list[this.pointer].style.backgroundColor = '#f7f7f7';
                getServiceItem(discounts[this.list[this.pointer].getAttribute(attr1)]);
                this.list[this.pointer].focus();
            }
        }
    }
}

function newDiscounts() {
    var lang = getLang();
    var $ = jQuery;
    //google Map: entry point for the whole page

    if(!sessionStorage.getItem('discount_data_backup_'+lang)){
        var xhr = new XMLHttpRequest();
        xhr.open("GET",api+"/api/v1/partners?limit=2500");
        xhr.onload = function(res){
            var p = JSON.parse(xhr.response).data;
            var pSanit = p.map(flatten).filter(function(e){return e});
            discounts = pSanit;
            renderNewDiscounts(discounts);
            sessionStorage.setItem('discount_data_backup_'+lang,JSON.stringify(discounts));
        }
        xhr.onerror=function(err){
            console.log(err);
        };
        xhr.send();
    }
    else{
        discounts = JSON.parse(sessionStorage.getItem('discount_data_backup_'+lang));
        renderNewDiscounts(discounts);
    }
}

function renderNewDiscounts(data,rows) {
    jQuery('.tohide').removeClass('hidden');
    var rowPossible = Math.floor(data.length/popularToRender);
    if(rows<rowPossible){
        rowForRender=rows;
    }
    if(data.length>popularToRender*rowForRender)
        jQuery('.load-more-discounts').show();
    else
        jQuery('.load-more-discounts').hide();
    if (popularToRender == 2)
        renderDiscountList(data);
    else
        renderDiscountList(data.slice(0,(popularToRender*rowForRender)));

    jQuery('.loader').addClass('hidden');
}

function sortByKey(array, key) {
    return array.sort(function(a, b) {
        var x = a[key]; var y = b[key];
        return ((x < y) ? -1 : ((x > y) ? 1 : 0));
    });
}

function convertToBengaliNumber(number) {
    if(getLang() != 'bn')
        return number ;
    var bn_digits = ['', '', '', '', '', '', '', '', '', ''];
    var i;
    var converted_number = "";
    for (i=0;i<number.toString().length;i++) {
        converted_number+=bn_digits[number.toString()[i]];
    }
    return converted_number;
}

function getIconByProviderType(e)
{
    if (e.providerType == 'Hospital' || e.providerType == '') {
        markerType = iconHospital;
    }  else if (e.providerType == 'Pharmacy' || e.providerType == '') {
        markerType = iconPharmacy;
    } else if (e.providerType == 'Diagnostics' || e.providerType == '') {
        markerType = iconDiagnostic;
    } else {
        markerType = iconLifestyle
    }

    if (e.execCheck == 'Yes') {
        markerType = iconExecutiveCheckup;
    }
    return markerType;
}
