    function convertToBengaliNumber(number) {
        if(getLang() != 'bn')
            return number;
        var bn_digits = ['', '', '', '', '', '', '', '', '', ''];
        var i;
        var converted_number = "";
        for (i=0;i<number.toString().length;i++) {
            converted_number+=bn_digits[number.toString()[i]];
        }
        return converted_number;
    }

    function readURL(input) {
        var types = ['image/png', 'image/jpeg', 'image/jpg'];

        if (input.files && input.files[0]) {
            if (types.indexOf(input.files[0]['type']) >= 0) {
                var reader = new FileReader();
                var file = input.files[0];
                reader.onload = function (e) {
                    $('.x-icons-bg').attr('src', e.target.result);
                }
                if (file) {
                    reader.readAsDataURL(file);
                }
            } else {
                if(getLang() == 'bn') {
                    alert("    .   JPG  PNG   ");
                } else {
                    alert("Uploaded file is not supported, please upload JPG or PNG file only.");
                }
            }

        }
    }

