    // Start Health Wallet
    $(document).on("change", '.date-field', function(event) {
        var start_date = "";
        var end_date = "";

        $('#form-save-claim-tonic-cash').slideUp('slow');
        $(".claim-type-place input:radio").removeAttr("checked");
        $('.required-documents').removeClass('error-text');
        $('.tonic-cash-type-section').slideUp('slow');
        $('.common-error-display').slideUp('slow');
        $('.no-available-claim').slideUp('slow');
        $('#not-eligible').slideUp('slow');
        $('.tonic-cash-type-section').html("");

        var membership_id = $('#membership-id').val();



        if ($(this).attr('id') == 'start_date' || $(this).attr('id') == 'end_date') {

            if ($('#start_date').val() == "") {
                // alert('Start date required');
                return false;
            } else {
                start_date = $('#start_date').val();

                if ($(this).attr('id') == 'start_date' && $('#end_date').val() == "") {
                    return false;
                }
            }

            if ($('#end_date').val() == "") {
                // alert('End date required');
                return false;
            } else {
                end_date = $('#end_date').val();
                if ($(this).attr('id') == 'end_date' && $('#start_date').val() == "") {
                    return false;
                }
            }

            var param = 'category_type='+$('.claim-category').val()+'&start_date='+start_date+'&end_date='+end_date;

            $.ajax({
                url: '/'+getLang()+'/tonic-cash-claim?'+param,
                beforeSend: function() { $('.health-wallet-loading').show('slow');},
                complete: function() { $('.health-wallet-loading').hide('slow');},
                method: 'POST',
                dataType: 'json',
                data: {membership_id: membership_id},
                success: function(data) {

                    if (data.error == true && data.error_type == 'empty data') {
                        $('#not-eligible').slideDown('slow');
                    } else if (data.error == true && data.error_type == 'message') {
                        $('.common-error-display .error-message').html(data.message);
                        $('.common-error-display').slideDown('slow');
                    } else {
                        $('.tonic-cash-type-section').html(data.html).slideDown('slow');
                    }
                }
            });
        }

        if ($(this).attr('id') == 'start_date1') {
            var param = 'category_type='+$('.claim-category').val()+'&start_date='+$('#start_date1').val();

            $.ajax({
                url: '/'+getLang()+'/tonic-cash-claim?'+param,
                beforeSend: function() { $('.health-wallet-loading').show('slow');},
                complete: function() { $('.health-wallet-loading').hide('slow');},
                method: 'POST',
                dataType: 'json',
                data: {membership_id: membership_id},
                success: function(data) {

                    if (data.error == true && data.error_type == 'empty data') {
                        $('#not-eligible').slideDown('slow');
                    } else if (data.error == true && data.error_type == 'message') {
                        $('.common-error-display .error-message').html(data.message);
                        $('.common-error-display').slideDown('slow');
                    } else {
                        $('.tonic-cash-type-section').html(data.html).slideDown('slow');
                    }
                }
            });
        }
    });

