function isNumberKey(evt)
{
    var charCode = (evt.which) ? evt.which : event.keyCode;
    if (charCode != 46 && charCode != 45 && charCode > 31
        && (charCode < 48 || charCode > 57))
        return false;
    var id = document.getElementById("roket-wallet-number").value;
    if (id.length > 0) {
        return false;
    }

    return true;
}

function autocomplete(inp, arr, codes) {
    var currentFocus;
    inp.addEventListener("input", function(e) {
        var a, b, i, val = this.value;
        closeAllLists();
        if (!val) { return false;}
        currentFocus = -1;
        a = document.createElement("DIV");
        a.setAttribute("id", this.id + "autocomplete-list");
        a.setAttribute("class", "autocomplete-items");
        this.parentNode.appendChild(a);
        for (i = 0; i < arr.length; i++) {
            if (arr[i].substr(0, val.length).toUpperCase() == val.toUpperCase()) {
                b = document.createElement("DIV");
                b.innerHTML = "<strong>" + arr[i].substr(0, val.length) + "</strong>";
                b.innerHTML += arr[i].substr(val.length);
                b.innerHTML += '<input class="partner_name" type="hidden" value="' + arr[i] + '">';
                b.innerHTML += '<input class="partner_code" type="hidden" value="' + codes[i] + '">';
                b.addEventListener("click", function(e) {

                    inp.value = this.getElementsByClassName("partner_name")[0].value;
                    document.getElementById('tonic-partner-code').value = this.getElementsByClassName("partner_code")[0].value;

                    closeAllLists();
                });
                a.appendChild(b);
            }
        }
    });

    inp.addEventListener("keydown", function(e) {
        var x = document.getElementById(this.id + "autocomplete-list");
        if (x) x = x.getElementsByTagName("div");
        if (e.keyCode == 40) {
            currentFocus++;
            addActive(x);
        } else if (e.keyCode == 38) {
            currentFocus--;
            addActive(x);
        } else if (e.keyCode == 13) {
            e.preventDefault();
            if (currentFocus > -1) {
                if (x) x[currentFocus].click();
            }
        }
    });
    function addActive(x) {
        if (!x) return false;
        removeActive(x);
        if (currentFocus >= x.length) currentFocus = 0;
        if (currentFocus < 0) currentFocus = (x.length - 1);
        x[currentFocus].classList.add("autocomplete-active");
    }
    function removeActive(x) {
        for (var i = 0; i < x.length; i++) {
            x[i].classList.remove("autocomplete-active");
        }
    }
    function closeAllLists(elmnt) {
        var x = document.getElementsByClassName("autocomplete-items");
        for (var i = 0; i < x.length; i++) {
            if (elmnt != x[i] && elmnt != inp) {
                x[i].parentNode.removeChild(x[i]);
            }
        }
    }

    document.addEventListener("click", function (e) {
        closeAllLists(e.target);
    });
}

function inject_autocomplete_partners() {
    var partners = [];
    var partner_codes = [];

    var currentPath = window.location.pathname;
    if (currentPath.match('claim-tonic-cash')) {

        if(!sessionStorage.getItem('tonic_discount_partner')){
            var xhr = new XMLHttpRequest();
            xhr.open("GET",api+"/api/v1/partners");
            xhr.onload = function(res){
                var discounts = JSON.parse(xhr.response).data;

                for (i = 0; i < discounts.length; i++) {
                    partners.push(discounts[i].name);
                    partner_codes.push(discounts[i].partner_code);
                }

                sessionStorage.setItem('tonic_discount_partner',JSON.stringify(partners));
                sessionStorage.setItem('tonic_discount_partner_code',JSON.stringify(partner_codes));
            }
            xhr.onerror=function(err){
                console.log(err);
            };
            xhr.send();
        }
        else{
            partners = JSON.parse(sessionStorage.getItem('tonic_discount_partner'));
            partner_codes = JSON.parse(sessionStorage.getItem('tonic_discount_partner_code'));
        }
    }

    autocomplete(document.getElementById("tonic_partner"), partners, partner_codes);
}
